useEffect(() => {
  fetch(`http://localhost:3000/api/products?timestamp=${Date.now()}`)
    .then(response => {
      if (!response.ok) {
        throw new Error('Failed to fetch products');
      }
      return response.json();
    })
    .then(data => {
      console.log(data);
      setProducts(data.products);
    })
    .catch(error => {
      console.error('Error fetching products:', error);
    });
}, []);
